authors":["Riemer Grootjans"],"publisher":"Apress","publishedDate":"2009-05-26","description":"Join the game development revolution today! XNA 3.0 greatly simplifies the development of your own games, lowering the barrier for programmers to get into game development. In XNA, you can start coding your games from the very start, a true revelation compared to other game programming environments. XNA doesn't sacrifice power for this ease of use—it is built entirely on DirectX technology. Completely updated for XNA 3.0, expert Riemer Grootjans brings together a selection of the hottest recipes in XNA programming for the Xbox 360, PC, and Zune. Advanced XNA programmers, experienced coders new to game development, and even complete beginners will find XNA 3.0 Game Programming Recipes an invaluable companion whether building games for fun or as commercial products.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781430218562"},{"type":"ISBN_10","identifier":"1430218568"}],"readingModes":{"text":false,"image":true},"pageCount":663,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"1.5.3.0.preview.1","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=1sIzdipoXuQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=1sIzdipoXuQC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com/books?id=1sIzdipoXuQC&printsec=frontcover&dq=subject:Programming&hl=&cd=2&source=gbs_api","infoLink":"http://books.google.com/books?id=1sIzdipoXuQC&dq=subject:Programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/XNA_3_0_Game_Programming_Recipes.html?hl=&id=1sIzdipoXuQC"},"saleInfo":{"country":"YE","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"YE","viewability":"PARTIAL","embeddable":true,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":true,"acsTokenLink":"http://books.google.com/books/download/XNA_3_0_Game_Programming_Recipes-sample-pdf.acsm?id=1sIzdipoXuQC&format=pdf&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"webReaderLink":"http://play.google.com/books/reader?id=1sIzdipoXuQC&hl=&source=gbs_api","accessViewStatus":"SAMPLE","quoteSharingAllowed":false}},{"kind":"books#volume","id":"9GwrmHRl490C","etag":"6gcn3/SAkjI","selfLink":"https://www.googleapis.com/books/v1/volumes/9GwrmHRl490C","volumeInfo":{"title":"Beginning XNA 3.0 Game Programming","subtitle":"From Novice to Professional","authors":["Bruno Evangelista","Alexandre Santos Lobao","Riemer Grootjans","Jose ANTONIO LEAL DEFARIAS"],"publisher":"Apress","publishedDate":"2009-05-31","description":"Would you like to create your own games, but never have the time to dig into the details of multimedia programming? Now you don't have to! XNA 3.0 makes it simple to create your own games, which will run on your PC and Xbox 360 console. Even if you don't know how to program at all, Beginning XNA 3.0 Game Programming: From Novice to Professional will teach you the basics of C# 2008 programming along the way. Don't get overwhelmed with details you don't need to know—just learn what you need to start creating your own games right now! This fast–paced introduction to XNA 3.0 and the C# language provides you with a quick–start guide to creating high–quality XNA games. You'll be introduced to the key concepts and ideas you need to know in a gradual fashion so that you master one concept before using it as a foundation for the next. Before long, you will have the skills to create smooth, professional–looking results in a range of gaming genres. By the end of the book, you will have constructed several working games and have an excellent knowledge base from which to investigate more advanced techniques.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781430218180"},{"type":"ISBN_10","identifier":"1430218185"}],"readingModes":{"text":true,"image":true},"pageCount":437,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"2.5.4.0.preview.3","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=9GwrmHRl490C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=9GwrmHRl490C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com/books?id=9GwrmHRl490C&printsec=frontcover&dq=subject:Programming&hl=&cd=3&source=gbs_api","infoLink":"http://books.google.com/books?id=9GwrmHRl490C&dq=subject:Programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Beginning_XNA_3_0_Game_Programming.html?hl=&id=9GwrmHRl490C"},"saleInfo":{"country":"YE","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"YE","viewability":"PARTIAL","embeddable":true,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":true,"acsTokenLink":"http://books.google.com/books/download/Beginning_XNA_3_0_Game_Programming-sample-epub.acsm?id=9GwrmHRl490C&format=epub&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"pdf":{"isAvailable":true,"acsTokenLink":"http://books.google.com/books/download/Beginning_XNA_3_0_Game_Programming-sample-pdf.acsm?id=9GwrmHRl490C&format=pdf&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"webReaderLink":"http://play.google.com/books/reader?id=9GwrmHRl490C&hl=&source=gbs_api","accessViewStatus":"SAMPLE","quoteSharingAllowed":false}},{"kind":"books#volume","id":"6pdiEQAAQBAJ","etag":"AEENobl2xNM","selfLink":"https://www.googleapis.com/books/v1/volumes/6pdiEQAAQBAJ","volumeInfo":{"title":"Artificial Intelligence and Games","authors":["Georgios N. Yannakakis","Julian Togelius"],"publisher":"Springer Nature","publishedDate":"2025-07-04","description":"This book covers artificial intelligence methods applied to games, both in research and game development. It is aimed at graduate students, researchers, game developers, and readers with a technical background interested in the intersection of AI and games. The book covers a range of AI methods, from traditional search, planning, and optimization, to modern machine learning methods, including diffusion models and large language models. It discusses applications to playing games, generating content, and modeling players, including use cases such as level generation, game testing, intelligent non-player characters, player retention, player experience analysis, and game adaptation. It also covers the use of games, including video games, to test and benchmark AI algorithms. The book is informed by decades of research and practice in the field and combines insights into game design with deep technical knowledge from the authors, who have pioneered many of the methods and approaches used in the field. This second edition of the 2018 textbook captures significant developments in AI and gaming over the past 7 years, incorporating advancements in computer vision, reinforcement learning, deep learning, and the emergence of transformer-based large language models and generative AI. The book has been reorganized to provide an updated overview of AI in games, with separate sections dedicated to AI’s core uses in playing and generating games, and modeling their players, along with a new chapter on ethical considerations. Aimed at readers with foundational AI knowledge, the book primarily targets three audiences: graduate or advanced undergraduate students pursuing careers in game AI, AI researchers and educators seeking teaching resources, and game programmers interested in creative AI applications. The text is complemented by a website featuring exercises, lecture slides, and additional educational materials suitable for undergraduate and graduate courses.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9783031833472"},{"type":"ISBN_10","identifier":"3031833473"}],"readingModes":{"text":true,"image":true},"pageCount":542,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"1.1.1.0.preview.3","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=6pdiEQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=6pdiEQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com/books?id=6pdiEQAAQBAJ&printsec=frontcover&dq=subject:Programming&hl=&cd=4&source=gbs_api","infoLink":"http://books.google.com/books?id=6pdiEQAAQBAJ&dq=subject:Programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Artificial_Intelligence_and_Games.html?hl=&id=6pdiEQAAQBAJ"},"saleInfo":{"country":"YE","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"YE","viewability":"PARTIAL","embeddable":true,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":true,"acsTokenLink":"http://books.google.com/books/download/Artificial_Intelligence_and_Games-sample-epub.acsm?id=6pdiEQAAQBAJ&format=epub&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"pdf":{"isAvailable":true,"acsTokenLink":"http://books.google.com/books/download/Artificial_Intelligence_and_Games-sample-pdf.acsm?id=6pdiEQAAQBAJ&format=pdf&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"webReaderLink":"http://play.google.com/books/reader?id=6pdiEQAAQBAJ&hl=&source=gbs_api","accessViewStatus":"SAMPLE","quoteSharingAllowed":false}},{"kind":"books#volume","id":"lESCCXkdy3YC","etag":"e0KYDuW/Adk","selfLink":"https://www.googleapis.com/books/v1/volumes/lESCCXkdy3YC","volumeInfo":{"title":"Gamers at Work","subtitle":"Stories Behind the Games People Play","authors":["Morgan Ramsay"],"publisher":"Apress","publishedDate":"2012-06-08","description":"\"Gamers at Work is a critical resource for new and experienced business leaders—for anyone who feels unprepared for the demanding and seemingly insurmountable trials ahead of them.\" —Peter Molyneux OBE, founder, Lionhead Studios \"Gamers at Work explores every imaginable subtlety of the video-game industry through the fascinating stories of those who took the risks and reaped the rewards.\" —Hal Halpin, president, Entertainment Consumers Association \"This is the sort of book that can tear the most hardcore gamers away from their PCs, Macs, or consoles for a few hours of rewarding reading.\" —North County Times \"Gamers at Work is truly an invaluable resource that's well worth adding to your personal library.\" —Wii Love It There are few companies in the video-game industry that have withstood the test of time; most startups exit as quickly as they enter. In Gamers at Work: Stories Behind the Games People Play, the countless challenges of building successful video-game developers and publishers in this unstable industry are explored through interviews containing entertaining stories, humorous anecdotes, and lessons learned the hard way. Gamers at Work presents an inside look at how 18 industry leaders play the odds, seize opportunities, and transform small businesses into great businesses. Here, in Gamers at Work, you will find their stories replete with their personal struggles, corporate intrigue, and insights into strategy, leadership, and management. Gamers at Work: Explores the formation of entertainment software companies from the perspectives of successful founders who played the odds Provides insight into why experienced professionals sacrifice the comfort of gainful employment for theuncertainty and risk of the startup Shares the experiences and lessons that shape the lives, decisions, and struggles of entrepreneurs in this volatile business As an added bonus, check out Online Game Pioneers at Work, published in 2015, for even more incredible stories from leaders in the mobile space. Featured Entrepreneurs: Trip Hawkins, Electronic Arts (Madden NFL) Nolan Bushnell, Atari (Pong) Wild Bill Stealey, MicroProse Software (Sid Meier's Civilization) Tony Goodman, Ensemble Studios (Age of Empires) Feargus Urquhart, Obsidian Entertainment (Star Wars: Knights of the Old Republic II) Tim Cain, Troika Games (Arcanum, Vampire: the Masquerade—Bloodlines) Warren Spector, Junction Point Studios (Disney Epic Mickey) Doug & Gary Carlston, Broderbund Software (Prince of Persia, Carmen Sandiego) Don Daglow, Stormfront Studios (Neverwinter Nights, Tony La Russa Baseball) John Smedley, Verant Interactive (EverQuest, PlanetSide) Ken Williams, Sierra On-Line (King's Quest, Leisure Suit Larry) Lorne Lanning, Oddworld Inhabitants (Oddworld) Chris Ulm, Appy Entertainment (FaceFighter, Trucks & Skulls) Tobi Saulnier, 1st Playable (Kung Zhu, Yogi Bear) Christopher Weaver, Bethesda Softworks (The Elder Scrolls) Jason Rubin, Naughty Dog (Crash Bandicoot, Uncharted) Ted Price, Insomniac Games (Spyro, Resistance) Other books in the Apress At Work Series: Coders at Work, Seibel, 978-1-4302-1948-4 Venture Capitalists at Work, Shah & Shah, 978-1-4302-3837-9 CIOs at Work, Yourdon, 978-1-4302-3554-5 CTOs at Work, Donaldson, Seigel, & Donaldson, 978-1-4302-3593-4 Founders at Work, Livingston, 978-1-4302-1078-8 European Founders at Work, Santos, 978-1-4302-3906-2 Women Leaders at Work, Ghaffari, 978-1-4302-3729-7 Advertisers at Work, Tuten, 978-1-4302-3828-7","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781430233527"},{"type":"ISBN_10","identifier":"1430233524"}],"readingModes":{"text":true,"image":true},"pageCount":345,"printType":"BOOK","categories":["Computers"],"m