lying and delivering information technology (IT) to your business needs through an innovative, game-based approach. Technology innovations and evolving business models are part of a rapid change that is forcing corporate and management professionals to learn, deploy, and adopt IT in new ways in order to maintain a competitive advantage. Many are doing this through experiential learning. You’ll begin by reviewing the basics of experiential learning and its relevance to IT, followed by six chapters that apply the hands-on concept through various scenarios. Make IT Through Experiential Learning one of your valued resources today. What You'll Learn: Innovative and proven IT-related application scenarios Generic management and leadership skill development Guidance for applying the learning methods for generating extraordinary results over conventional methods Who This Book Is For: IT professionals, higher education students, and those engaged in training and organizational development.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781484224212"},{"type":"ISBN_10","identifier":"1484224213"}],"readingModes":{"text":true,"image":true},"pageCount":108,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"1.3.3.0.preview.3","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=ezCIDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=ezCIDQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com/books?id=ezCIDQAAQBAJ&printsec=frontcover&dq=subject:Programming&hl=&cd=6&source=gbs_api","infoLink":"http://books.google.com/books?id=ezCIDQAAQBAJ&dq=subject:Programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/IT_Through_Experiential_Learning.html?hl=&id=ezCIDQAAQBAJ"},"saleInfo":{"country":"YE","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"YE","viewability":"PARTIAL","embeddable":true,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":true,"acsTokenLink":"http://books.google.com/books/download/IT_Through_Experiential_Learning-sample-epub.acsm?id=ezCIDQAAQBAJ&format=epub&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"pdf":{"isAvailable":true,"acsTokenLink":"http://books.google.com/books/download/IT_Through_Experiential_Learning-sample-pdf.acsm?id=ezCIDQAAQBAJ&format=pdf&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"webReaderLink":"http://play.google.com/books/reader?id=ezCIDQAAQBAJ&hl=&source=gbs_api","accessViewStatus":"SAMPLE","quoteSharingAllowed":false}},{"kind":"books#volume","id":"MNqRDwAAQBAJ","etag":"cpLfV0NTFZ0","selfLink":"https://www.googleapis.com/books/v1/volumes/MNqRDwAAQBAJ","volumeInfo":{"title":"Ray Tracing Gems","subtitle":"High-Quality and Real-Time Rendering with DXR and Other APIs","authors":["Eric Haines","Tomas Akenine-Möller"],"publisher":"Apress","publishedDate":"2019-02-25","description":"This book is a must-have for anyone serious about rendering in real time. With the announcement of new ray tracing APIs and hardware to support them, developers can easily create real-time applications with ray tracing as a core component. As ray tracing on the GPU becomes faster, it will play a more central role in real-time rendering. Ray Tracing Gems provides key building blocks for developers of games, architectural applications, visualizations, and more. Experts in rendering share their knowledge by explaining everything from nitty-gritty techniques that will improve any ray tracer to mastery of the new capabilities of current and future hardware. What you'll learn: The latest ray tracing techniques for developing real-time applications in multiple domains Guidance, advice, and best practices for rendering applications with Microsoft DirectX Raytracing (DXR) How to implement high-performance graphics for interactive visualizations, games, simulations, and more Who this book is for: Developers who are looking to leverage the latest APIs and GPU technology for real-time rendering and ray tracing Students looking to learn about best practices in these areas Enthusiasts who want to understand and experiment with their new GPUs","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781484244272"},{"type":"ISBN_10","identifier":"1484244273"}],"readingModes":{"text":false,"image":false},"pageCount":622,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":true,"contentVersion":"0.2.3.0.preview.0","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=MNqRDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=MNqRDwAAQBAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api"},"language":"en","previewLink":"http://books.google.com/books?id=MNqRDwAAQBAJ&dq=subject:Programming&hl=&cd=7&source=gbs_api","infoLink":"http://books.google.com/books?id=MNqRDwAAQBAJ&dq=subject:Programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Ray_Tracing_Gems.html?hl=&id=MNqRDwAAQBAJ"},"saleInfo":{"country":"YE","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"YE","viewability":"NO_PAGES","embeddable":false,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":true},"webReaderLink":"http://play.google.com/books/reader?id=MNqRDwAAQBAJ&hl=&source=gbs_api","accessViewStatus":"NONE","quoteSharingAllowed":false}},{"kind":"books#volume","id":"y1kGzaLuffAC","etag":"Dpvl3f/MYDU","selfLink":"https://www.googleapis.com/books/v1/volumes/y1kGzaLuffAC","volumeInfo":{"title":"Beginning Android Tablet Games Programming","authors":["Jeremy Kerfs"],"publisher":"Apress","publishedDate":"2012-01-13","description":"Android games programmers now have the power to write games for Android tablets. Beginning Android Tablet Games Programming explains how to enhance your Android games using the new tablet interface and the additional screen estate. You'll learn how to bring your programming skills up to date and into a world where touch screens, games physics, and artificial intelligence come together in new and surprising ways. Beginning Android Tablet Games Programming shows how to quickly and easily set up an Android development environment—in no time at all, you'll be programming away. You'll begin with some simple games using sprites and choreographed movement. Next, you'll learn how to handle user input in the modern age of touch screens and motion. Along the way, you'll discover how to use that extra screen space on a tablet to provide more relaxed and more interesting user interactions in your games. You'll learn how to use sound and music, for instance, to make your application menus more user-friendly. The Android operating system has recently acquired multicore functionality to meet the demands of multicore devices now entering the tablet market. With Beginning Android Tablet Games Programming, you'll discover how to harness that new power with your games programming through more process-demanding and fun techniques, including physics modeling, rich game world representation, artificial intelligence, and multiplayer interactions. Throughout each chapter of Beginning Android Tablet Games Programming, you'll find code that you can add or adapt to your own games to create the components you want. You can also work up to wrapping everything together into a complete Mario-type example game. Finally, when you have your first games ready, learn how developers have released their games and made a profit. You'll find tips on how to present your games in the Android andother application markets, and a solid approach to games marketing and monetization.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781430238539"},{"type":"ISBN_10","identifier":"1430238534"}],"readingModes":{"text":true,"image":true},"pageCount":197,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"2.7.6.0.preview.3","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=y1kGzaLuffAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=y1kGzaLuffAC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com/books?id=y1kGzaLuffAC&printsec=frontcover&dq=subject:Programming&hl=&cd=8&source=gbs_api","infoLink":"http://books.google.com/books?id=y1kGzaLuffAC&dq=subject:Programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Beginning_Android_Tablet_Games_Programmi.html?hl=&id=y1kGzaLuffAC"},"saleInfo":{"country":"YE","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"YE","viewability":"PARTIAL","embeddable":true,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":true,"acsTokenLink":"http://books.google.com/books/download/Beginning_Android_Tablet_Games_Programmi-sample-epub.acsm?id=y1kGzaLuffAC&format=epub&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"pdf":{"isAvailable":true,"acsTokenLink":"http://books.google.com/books/download/Beginning_Android_Tablet_Games_Programmi-sample-pdf.acsm?id=y1kGzaLuffAC&format=pdf&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"webReaderLink":"http://play.google.com/books/reader?id=y1kGzaLuffAC&hl=&source=gbs_api","accessViewStatus":"SAMPLE","quoteSharingAllowed":false}},{"kind":"books#volume","id":"6BaJDwAAQBAJ","etag":"yBvFOlUDmOc","selfLink":"https: